import Link from 'next/link'

const Index = () => {
    return (
        <div>
            <Link href='/about'><button>About!</button></Link>
            <Link href='/contact'><a>Contact Page</a></Link>
            <h1>Our Index Page</h1>
        </div>
    )
}

export default Index
